import React from "react";
import Main from "./Components/project11/Main";
import Employee from "./Components/project11/Employee";
import { Route, Routes } from "react-router-dom";
// import Home from "./pratice-9/Home";
// import Navbar from "./pratice-9/Navbar";
// import About from "./pratice-9/About";
// import Contact from "./pratice-9/Contact";
function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Main />} />
        <Route path="/loginpage" element={<Employee />} />
      </Routes>
    </>
  );
}

export default App;
